import { useState } from "react";

const animals = ["Dog", "Cat", "Rat"];

const [filterVal, setFilterVal] =useState("");

const Example = () => {
  return (
    <>
      <h3>配列のフィルター</h3>
      <input type="text" value={ filterVal } onChange={(e)=>{
        setFilterVal(e.target)
      }}></input>
      <ul>
        {animals
          .map((animal) => (
          <li>{animal}</li>
        ))}
      </ul>
    </>
  );
};

export default Example;
